<p>I will point out two things just as a nitpick:</p>
<p>1.) You seem to use two spaces for indentation, which is fine, although the standard in most projects seems to be four spaces as it’s more readable that way. Establish consensus with your programming team before changing this.</p>
<p>2.) At the end of your <code>teleopPeriodic()</code> method, you have the end curly brace in a weird position:</p>
<pre><code class="lang-auto">  public void teleopPeriodic() {
  ...
    m_robotDrive.driveCartesian(xAxis, yAxis, zAxis, 0.0);}
}
</code></pre>
<p>The code will run just the same in any case, but you should move the curly brace to a new line:</p>
<pre><code class="lang-auto">  public void teleopPeriodic() {
  ...
    m_robotDrive.driveCartesian(xAxis, yAxis, zAxis, 0.0);
  }
}
</code></pre>
